import React, { useState } from "react";

const RegistrationOverlay2 = (onClose, onRegisterEmail) => {
  const [First_Name, setFirstName] = useState("");
  const [Last_Name, setLastName] = useState("");
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const [passwordConfirm, setPasswordConfirm] = useState("");

  const handleSubmit = (event) => {
    event.preventDefault();
    console.log(email);
  };

  return (
    <div className="overlay2">
      <div className="overlay2-content">
        <form className="overlay2-form" onSubmit={handleSubmit}>
          <div className="create-close-btn-container">
            {/* <button className="overlay-back-button"> back </button>
            <button className="overlay-close-button" onClick={onClose}>
              {" "}
              close{" "}
            </button> */}
          </div>
          <h2 className="overlay-2-header"> Create Account By Email </h2>
          <div className="overlay-input-container">
            <label htmlFor="First_Name"> First Name </label>
            <input
              type="text"
              id="First_Name"
              name="First_Name"
              placeholder="First Name"
              required
              onChange={(event) => {
                setFirstName(event.target.value);
              }}
            />
            <label htmlFor="Last_Name"> Last Name </label>
            <input
              type="text"
              id="Last_Name"
              name="Last_Name"
              placeholder="Last Name"
              required
              onChange={(event) => {
                setLastName(event.target.value);
              }}
            />
            <label htmlFor="email"> E-mail </label>
            <input
              type="text"
              id="email"
              name="email"
              placeholder="E-mail"
              required
              onChange={(event) => {
                setEmail(event.target.value);
              }}
            />
            <label htmlFor="password"> Password </label>
            <input
              type="text"
              id="password"
              name="password"
              placeholder="Password"
              required
              onChange={(event) => {
                setPassword(event.target.value);
              }}
            />
            <label htmlFor="passwordConfirm"> Confirm Password </label>
            <input
              type="text"
              id="passwordConfirm"
              name="passwordConfirm"
              placeholder="Confirm Password"
              required
              onChange={(event) => {
                setPasswordConfirm(event.target.value);
              }}
            />
            <button
              className="overlay2-button"
              type="submit"
              onClick={() =>
                onRegisterEmail(
                  First_Name,
                  Last_Name,
                  email,
                  password,
                  passwordConfirm
                )
              }
            >
              {" "}
              Register{" "}
            </button>
          </div>
        </form>
      </div>
    </div>
  );
};

export default RegistrationOverlay2;
